import { BASE_PATH, apiVersion } from "./config";

export function LoginApi(data) {

    const url = `${BASE_PATH}/${apiVersion}/login`;
    const params = {

        method: "GET",
        body: JSON.stringify(data),
        headers: {
            "Content-Type": "application/json"
        }

    };

    console.log(data);

    fetch(url, params)
        .then(response => {

            console.log(response);
        });
